import { Component } from "react";
const styles = {
    carro: {
        width:'250px',
    }
}

class Carro extends Component{
    render() {
        return (
            <div>
                <img style={styles.carro } src="/img/carro-de-compras-rapido.png" alt="Carrito de compras" />
            </div>
        )
    }
}
export default Carro
